import datetime
from typing import List, Dict, Optional

class Submission:
    def __init__(self, submission_id: int, user_id: int, status: str, created_at: datetime.datetime):
        self.submission_id = submission_id
        self.user_id = user_id
        self.status = status
        self.created_at = created_at
        self.errors: List[str] = []

    def add_error(self, error_message: str):
        self.errors.append(error_message)

class User:
    def __init__(self, user_id: int, user_type: str):
        self.user_id = user_id
        self.user_type = user_type
        self.submissions: List[Submission] = []

    def submit(self, submission: Submission):
        self.submissions.append(submission)

class FABSUser(User):
    def __init__(self, user_id: int):
        super().__init__(user_id, "FABS")

    def download_file(self, submission: Submission):
        return f"Downloading file for submission ID: {submission.submission_id}"

class UIUser(User):
    def __init__(self, user_id: int):
        super().__init__(user_id, "UI")

    def report_to_agencies(self, issue_summary: str):
        print(f"Reporting to agencies: {issue_summary}")

    def move_on_to_round(self, page_type: str, round_number: int):
        print(f"Moving on to round {round_number} of {page_type} edits for approvals.")

class Developer(User):
    def __init__(self, user_id: int):
        super().__init__(user_id, "Developer")

    def log_issue(self, message: str):
        print(f"Logging issue: {message}")

    def update_validation_rule(self, rule_id: int, updates: Dict):
        print(f"Updating validation rule {rule_id} with updates: {updates}")

class AgencyUser(User):
    def __init__(self, user_id: int):
        super().__init__(user_id, "Agency")

    def upload_file(self, submission: Submission):
        if submission.errors:
            print(f"Upload failed for submission ID {submission.submission_id} with errors: {submission.errors}")
        else:
            print(f"File uploaded successfully for submission ID {submission.submission_id}")

class Broker:
    def __init__(self):
        self.submissions: List[Submission] = []

    def process_deletions(self, deletion_date: datetime.date):
        print(f"Processing deletions for date: {deletion_date}")

    def generate_d1_file(self):
        print("Generating D1 file synced with FPDS data load.")

    def prevent_double_submission(self, submission_id: int):
        print(f"Preventing double submission for submission ID {submission_id}")

class Validation:
    @staticmethod
    def validate_submission(submission: Submission) -> bool:
        if not submission.errors and submission.status == "valid":
            return True
        return False

def main():
    broker = Broker()
    broker.process_deletions(datetime.date(2017, 12, 19))

    # Example usage
    user1 = FABSUser(user_id=1)
    submission1 = Submission(submission_id=101, user_id=user1.user_id, status="valid", created_at=datetime.datetime.now())

    user1.submit(submission1)
    user1.download_file(submission1)

    ui_user = UIUser(user_id=2)
    ui_user.move_on_to_round("Homepage", 2)

    developer = Developer(user_id=3)
    developer.log_issue("Issue with submission ID 101.")
    developer.update_validation_rule(1, {"required": "FundingAgencyCode"})

    agency_user = AgencyUser(user_id=4)
    agency_user.upload_file(submission1)

if __name__ == "__main__":
    main()
